import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './SelectTimePage.css'; // Import your CSS file for styling

const SelectTimePage = () => {
  const [preferredTime, setPreferredTime] = useState('');
  const navigate = useNavigate();

  const handleSubmit = (event) => {
    event.preventDefault();
    alert(`Preferred notification time: ${preferredTime}`);
    navigate('/welcome');
  };

  return (
    <div className="select-time-page">
      <div className="header">
        <h2>Select Your Preferred Notification Time</h2>
      </div>
      <div className="main-content">
        <form onSubmit={handleSubmit}>
          <label className="time-label">
            Enter your preferred time:
            <input
              type="time"
              value={preferredTime}
              onChange={(e) => setPreferredTime(e.target.value)}
              required
              className="time-input"
            />
          </label>
          <button type="submit" className="submit-button">
            Submit
          </button>
        </form>
      </div>
      <div className="footer">
        {/* Additional navigation or actions can go here */}
      </div>
    </div>
  );
};

export default SelectTimePage;
